import React from 'react'
import web from './images/office.jpg'
import Common from './Common';

const About = () => {
    return(
        <>
            <Common 
                name="Welcome To About Page"
                imgsrc = {web}
                visit="/contact"
                btname = "Contact Now"
            />
        </>
    );
}

export default About
